window.bookSummaryJSON = "<p>No longer on her home turf, she faces new challenges, new enemies....</p> <p>And dragons. Yes. Dragons.</p> <p>\"My name is Rylee, and I am a Tracker.\"</p> <p>When children go missing, and the Humans have no leads, I'm the one they call. I am their last hope in bringing home the lost ones. I salvage what they cannot.</p> <p>O’Shea is AWOL, and Tracking him is proving to be harder than I expected.</p> <p>Not to mention the small fact that I have the Beast of Bodmin Moor chasing me across Europe, in a race against the odds, and my life as the prize.</p> <p>But those things are minor compared to the secrets that finally come to light.</p> <p>Secrets I wish had stayed hidden in the darkness....</p> <p>Performed by Nora Achrati, Bradley Smith, Shanta Parasuraman, Chris Genebach, Michael Glenn, James Konicek, Ken Jackson, Amanda Forstrom, Zeke Alton, Yasmin Tuazon, Eric Messner, Holly Vagley, Colleen Delany, Steven Carpenter, Laura C. Harris, Andy Brownstein, Richard Rohan, Patrick Bussink, Rose Elizabeth Supan, Nanette Savard and Niusha Nawab.</p>"; 
